// import { Carousel } from "bootstrap/dist/js/bootstrap.bundle";
import React from "react";
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from 'react-responsive-carousel';

const Stakeholders = () => {
    return (
        <>
        <div className="stakeholders-style">
            <Carousel>
                
                    <div>
                        <img className="stakeholders" src="https://saraswati-seva-foundation.org/wp-content/uploads/2023/03/ms_bajpai.jpg" alt="shipra" />
                    </div>
                    <div>
                        <img className="stakeholders" src="https://saraswati-seva-foundation.org/wp-content/uploads/2023/03/farhat.jpg" alt="farhat" />
                    </div>
                    <div>
                        <img className="stakeholders" src="https://saraswati-seva-foundation.org/wp-content/uploads/2023/03/roopesh.jpg" alt="roopesh" />
                    </div>
                


            </Carousel>
            </div>
        </>
    );
}

export default Stakeholders;
